int main(int argc,char *argv[])
{
  try
  {

    glsCommandLine::Instance()->ReadCommandLine(argc,argv);

    gLStudio_Altimeter = new GLStudio_AltimeterClass("GLStudio-Altimeter",500,498);
    gLStudio_Altimeter->CreateObjects();

//////////////////// User Code from section: "Main Initialization" ////////////
///////////////////////////////////////////////////////////////////////////////
    gLStudio_Altimeter->SetRedraw();

    Timer frameTimer;
    do
    {
//////////////////// User Code from section: "Main Loop" //////////////////////
///////////////////////////////////////////////////////////////////////////////
        gLStudio_Altimeter->RecordCalculateStart();
        gLStudio_Altimeter->Calculate(frameTimer.ElapsedSecondsDouble());
        gLStudio_Altimeter->RecordCalculateEnd();
    }
    while(gLStudio_Altimeter->FrameAnimate());

    // Delete the instance
    delete gLStudio_Altimeter;

  }
  catch(DistiException e)
  {
    Error(e.what());
  }
  return 0;
}
